'use strict';

function jsonRenderer(data) {
  try {
    console.log(data.text);
    return JSON.parse(data.text);
  } catch (error) {
    console.error('Error parsing JSON:', error);
    console.error('Data:', data);
  }
}

module.exports = jsonRenderer;